//     //   navigate("/dashboard");
//     // }
//     // opcja dostępu inny niz admin do dashboard
//   }, [isError,
//     //user,
    
//     navigate]);
return (
    <div>
      <div className="div-table"> 
      <table className="employee-table"> 
        <thead>
          <tr className="employee-tr">
            <th>ID:</th>
            <th>Imie Nazwisko</th>
            <th>Stanowisko</th>
            <th>Oddział</th>
            <th>Email</th>
            <th>Doświadczenie</th>
            <th>Umowa</th>
            <th>Opcje</th>
          </tr>
        </thead>
        <tbody>
          {user.map((user, index) => (
            <tr key={user.uuid} className="employee-tr">
              <td className="td-employee"> {index + 1} </td>
              <td className="employee-profile td-employee">     
              { user.sex == "Kobieta"?
                <AvatarWoman className="employee-icon"/>
               :
                <AvatarMan className="employee-icon"/>
               }
              {user && `${user.name} ${user.surname}`}</td>
              <td className="td-employee">{user.position} {user.role}</td>
              <td className="td-employee">Mników</td>
              <td className="td-employee">{user.email}</td>
              <td className="td-employee">1rok</td>
              <td className="td-employee">{user.agreement} </td>
              <td className="td-employee">
                <Link to={`/products/edit/${user.uuid}`}><SettingTwoIcon/></Link>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      </div> 
    </div>
  );
};

export default TableEmployee;
